pub fn readCOctal(s: String) -> Either<String, CInteger> {
    if s[0] == '0' {
        if isDigit(s[1]) {
            readCInteger(OctalRepr, s[1..].to_string())
        } else {
            readCInteger(DecRepr, s)
        }
    }  else {
        __error!("ReadOctal: string does not start with `0\'".to_string())
    }
}

