pub fn ignoreAttribute() -> P<()> {

    pub fn skipTokens(n: isize) -> P<()> {
        /*do*/ {
            let ntok = lexToken_q(false);

            match ntok {
                CTokRParen(_) if (n == 1) => { __return(()) }
                CTokRParen(_) => { skipTokens(((n - 1))) }
                CTokLParen(_) => {
                    skipTokens(((n + 1)))
                },
                _ => {
                    skipTokens(n)
                },
            }
        }
    }

    skipTokens((0))
}

